import React from "react";

export default function Habits() {
  return (
    <div className="center">
      <h6>Login or Signup for Track the Habits</h6>
      <figure>
        <img src="https://assets.plan.io/images/blog/daily-routines-and-habits.png" alt="habit" />
      </figure>
    </div>
  );
}
